import React, { Component } from 'react';
import Barin from './Barin';
import '../Content.css'


class About extends Component {
    render() {
        return (
            <div id="font">
                <Barin />
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-lg-12">
                          
                            </div>
                        </div>

                   

                    <br />
                    <div className="row animated zoomIn delay-2s " >
                        <div class="col-lg-1">
                        </div>

                    </div>


                </div>
            </div>
        );
    }

}
export default About;
